// Header component for URL Shortener
import React from 'react';
import '/Header.css'

function Header(){
    return(
        <>
        <div className='Header'>
            <ul>
                <li>  Shortly </li>
                <li> Features</li>
                <li> Resources</li>
                <li> Login</li>
                <li> Sign up</li>
            </ul>

        </div>
        </>
    );
}

export default Header;
